"<p>This class encapsulates a <i>collection</i> of DOM elements, providing methods to filter
members, or to perform collective actions upon the whole set.</p>


<p>Although they are not listed, this class supports all of the methods of <a href="#/api/Ext.core.Element" rel="Ext.core.Element" class="docClass">Ext.core.Element</a> and
<a href="#/api/Ext.fx.Anim" rel="Ext.fx.Anim" class="docClass">Ext.fx.Anim</a>. The methods from these classes will be performed on all the elements in this collection.</p>


<p>All methods return <i>this</i> and can be chained.</p>


<p>Usage:</p>

<pre><code>var els = Ext.select("#some-el div.some-class", true);
// or select directly from an existing element
var el = Ext.get('some-el');
el.select('div.some-class', true);

els.setWidth(100); // all elements become 100 width
els.hide(true); // all elements fade out and hide
// or
els.setWidth(100).hide(true);
</code></pre>

